import React, {useState} from "react";
import useToggle from "../hooks/useToggle";

// Usage
function Dice() {
    const [isTextChanged, setIsTextChanged] = useToggle();
    const [count, setCount] = useState(0);

    return (
        <button onClick={() => {
          setCount(count + 1);
          setIsTextChanged();
        }}>
          {isTextChanged ? "Toggled" : "Click to Toggle"}
        </button>
    );
}

export default Dice;
